Péssimo o atendimento para comigo
Fiz um pedido,  ec logo apos  lembrei que teria uma consulta médica,  então perguntei por chat se o pedido estaria sendo entregue no horário estimado;
disseram que sim, mas  chegou com 30 minutos de atraso. E quem atendeu não consegue simplesmente ser sincero com uma pergunta . A comida chegou com atraso expressivo e toda bagunçado. Péssima a apresentação.

Lanche muito bom, contudo eu pedi o hamburguer ao ponto - eu acho q deveri vir com o interior rosado, mas não sangrando, e a carne saiu no ponto mais - sem nada de vermelho por dentro;
Bacon muito bom;
Batata frita boa, na próxima vou pedir a rústica;
O bar oferecia muitas, e boas, opções de Chopp;
Hamburgueria de bairro, q tem potencial para concorrer com as tops.
Recomendo e voltaria.

Excelente lugar pra tomar um café ☕️,  um lanche, um almoço;
Atendimento dos melhores
Nota 1000
